(1, 0, 1568444044, 1568444044, 29, 'Haqqımızda', 'Haqqımızda', '<ul><li>TexnoStar.az - Onlayn Mağazadır. Partnyor Mağazalar tərəfindən təqdim edilən məhsulların m&uuml;ştərilərə qısa zaman ərzində &ccedil;atdırılmasını həyata ke&ccedil;irir. Məhsul &ccedil;eşidlərimizə Wifi Kamera, 4G Kamera, VideoQeydiyyat&ccedil;ı, IP kameralar və s. Elektronika məhsulları daxildir. Sifarişlər 24 saat ərzində PULSUZ &ccedil;atdırılır.<p><br></p></li><li>0552742030</li><li>info@texnostar.az</li></ul>', '{\"link\":\"https://www.autoauksion.az/uploads/images/5e551f2fcae4256bebd7865edcfc366c.jpg\"}', 'haqqimizda97887', '', '', 0, '2019-09-14 06:54:04', 'true', 'true', 'true', 'true'),
