(14, 0, 1631087999, 0, 29, 'Geri Qaytarılma', 'Geri Qaytarılma', '<p>14 g&uuml;n ərzində hər-hansı istehsal&ccedil;ı q&uuml;suru aşkarlanarsa məhsulun original qutusunda və zədələnməmiş halda qaytarılması və ya dəyişdirilməsi m&uuml;mk&uuml;nd&uuml;r.</p><p>Məhsulun təchizat&ccedil;ının &uuml;nvanına geri qaytarılması xərci m&uuml;ştəri tərəfindən &ouml;dənilir.</p>', NULL, 'geri-qaytarilma', '', '', 0, '2021-09-08 07:59:59', 'true', '', '', ''),
