(19, 0, 1656392244, 0, 29, 'Privacy Policy (Gizlilik Siyasəti)', 'Privacy Policy (Gizlilik Siyasəti)', '<p>GİZLİLİK SİYASƏTİ</p><p>M&uuml;xtəlif mağazaları bir &uuml;nvanda birləşdirən TexnoStar.az veb saytına daxil olan istifadə&ccedil;ilərin paylaşdığı məlumatların məxfiliyini təmin etmək prinsipini qəbul etmişdir. Bu səbəbdən, bu &ldquo;Gizlilik Siyasəti&rdquo; yaradıldı. Bu məlumat &nbsp;TexnoStar.az tərəfindən hansı məlumatın hansı məqsədlə tələb etdiyini izah etmək &uuml;&ccedil;&uuml;n yaradıldı. TexnoStar.az hər hansı bir istiqamətdən sizə təqdim etdiyi b&uuml;t&uuml;n xidmətlər qısaca &nbsp;&ldquo;məhsul&rdquo; adlanır.</p><p>TexnoStar.az saytında kukilərdən fəaliyyət məqsədilə istifadə edir.</p><p>Kukilər daxil olduğunuz web saytlar tərəfindən kompyuterinizə yerləşdirilən ki&ccedil;ik mətn fayllarıdır. Onlardan saytın fəaliyyəti və unikal istifadə&ccedil;ilərin saytı nə c&uuml;r istifadə etdiklərinə g&ouml;rə ayırmaq &uuml;&ccedil;&uuml;n geniş istifadə olunur. Toplanmış məlumatlar anonimdir və he&ccedil; bir şəxsi məlumat təşkil etmir.</p><p><br></p><p>Sessiya Kukilər TexnoStar.az saytında veb saytın dilinin dəyişilməsi &nbsp;kimi funksyaların fəaliyyəti məqsədilə istifadə edilir. Sessiya Kukilər yalnız sayta daxil olan zaman ərzində davam edir.</p><p><br></p><p>Sayt həm də istifadə&ccedil;ilərin haradan daxil olduğunu və saytın ən &ccedil;ox hansı hissələrindən istifadə etdiyini yoxlamaq &uuml;&ccedil;&uuml;n Google Analytics-dən istifadə edir. Bu, sizin saytdan istifadə etdiyiniz zaman təcr&uuml;bənizin artmasında inkişafa k&ouml;mək edir. Google Analytica Kukilər sayta daxil olanlar haqqında şəxsi məlumatlar toplamır. Google Analyticsdə daha ətraflı məlumat &uuml;&ccedil;&uuml;n https://developers.google.com/analytics/resources/concepts/gaConceptsCookies</p><p>Cookies silsəniz, saytın tam funksionallığından istifadə edə bilmərsiniz.</p><p>Şəxsi məlumatlar</p><p>Biz sizin k&ouml;n&uuml;ll&uuml; razılığınız olmadan şəxsi məlumatlarınızı ( ad, &uuml;nvan, telefon və e-mail &uuml;nvanı) toplamırıq.&nbsp;</p><p>Bu məlumatlarla nə edə bilərik:</p><p>&Ouml;z razılığınızla qeyd etdiyiniz Telefon n&ouml;mrənizə biz qısa Reklam SMS -ləri və ya kampanyalarımız haqqında məlumat g&ouml;ndərə bilərik.&nbsp;</p><p>Qeyd etdiyiniz E-Mail &uuml;nvanınıza biz reklam və ya kampanyalarımız haqqında mail g&ouml;ndərə bilərik.</p><p>Əgər e-mail və telefon vasitəsi ilə kampanyalarımızdan xəbərdar olmaq istərmirsinizsə&nbsp;info@texnostar.az&nbsp;addresindən bizə mail g&ouml;ndərərək iradınızı bildirə bilərsiniz.</p><p>Digər saytlara linklər</p><p>Bizin saytımızdan hər hansı linki tıklayaraq ke&ccedil;id etdiyiniz biznes tərəfdaşlarımızın saytında daha az gizlilik siyasəti aparılır. Biz onların siyasətini idarə etmirik və sizi gizlilik bəyanatını oxumadan şəxsi məlumatlarınızı təqdim etməməyə &ccedil;ağırırıq.</p><p>Aşağıdakı məlumatları yığa bilərik:</p><p>Qoşulma vaxtı və tarix</p><p>İstifadə&ccedil;i tərəfindən istifadə edilən cihaz, əməliyyat sistemi və brauzer haqqında ətraflı məlumat;</p><p>Istifadə&ccedil;inin IP &uuml;nvanı;</p><p>M&uuml;ştəri Web saytının a&ccedil;ılış səhifəsinin URL;</p><p>Istiqamətləndirən web saytının URL;</p><p>İstifadə&ccedil;i tərəfindən M&uuml;ştəri Web Saytına &ccedil;atmaq &uuml;&ccedil;&uuml;n istifadə edilən axtarış termini.</p><p>Qeyri-şəxsi məlumatlar</p><p>Biz sizin haqqınızda şəxsi olmayan məlumatları toplaya bilərik (məsələn, istifadə etdiyiniz internet brauzer)</p><p>Bu məlumatı necə əldə edə bilərik:</p><p>Biz bu məlumatları sizing kompyuterinizdə saxlanılan kukilər vasitəsilə əldə edə bilərik. Bir &ccedil;ox internet brauzerlərdə siz bu məlumatları kompyuterin hard diskindən silə bilərsiniz.</p><p>Biznes partnyorları</p><p><br></p><p>Məlumatlarınızı həmişə zaman sizə ən yaxın xəbər və təkliflərimizlə telefon, mətn və ya e-mail ilə aktual tutmaq &uuml;&ccedil;&uuml;n sizinlə &uuml;nsiyyətə ke&ccedil;ə biləcək iş tərəfdaşlarla b&ouml;l&uuml;şə bilərik. Bu yazışmaları almaq istəsəniz və ya bu kampanyalardan hansını se&ccedil;ib sə&ccedil;mədiyinizdən əmin deyilsinizsə (+994) 55 274 20 30 və ya info@texnostar.az &uuml;nvanından bizimlə əlaqə saxlaya bilərsiniz. M&uuml;mk&uuml;n olan qədər qısa m&uuml;ddətdə məlummatları sizinlə paylaşmağa &ccedil;alışacağıq. Amma bəzən gecikmə ola bilər.</p>', NULL, 'privacy-policy-gizlilik-siyaseti648022899491671', '', '', 0, '2022-06-28 04:57:24', 'true', 'true', 'true', 'true'),
(20, 5, 1690451848, 0, 29, 'Əlaqə', 'Əlaqə', '<p><br></p><p>Əməkdaşlıq təklifləri &uuml;&ccedil;&uuml;n: info<a href=\"mailto:business@shopstar.az\">@texnostar.az</a></p><p>Saytımızda məhsul sifariş edərkən və ya mağaza yaradarkən ad, soyad, &uuml;nvan, mobil n&ouml;mrə və .s məlumatlar identifikasiya məqsədilə toplanır. Saytda olan mağaza, məhsul vəya istifadə&ccedil;i hesablarının silinməsi &uuml;&ccedil;&uuml;n <a href=\"mailto:info@shopstar.az\">info@texnostar.az</a> vəya WhatsApp +994552742030 n&ouml;mrəmizlə əlaqə saxlaya bilərsiniz.</p>', NULL, 'elaqe861494614', '', '', 1, '2023-07-27 09:57:28', 'true', 'true', 'true', 'true');
INSERT INTO `products` (`id`, `category`, `color`, `description`, `feature_name`, `feature_value`, `price`, `size`, `stok`, `title`, `url_tag`, `store_id`, `share`, `date`, `product_id`, `free_deliver`, `home`, `history_list`, `last_modified`) VALUES
(715, 1688843401, '[\"\"]', '<p>Hazırda stokda yoxdur. Yalnız sifarişlə gətirilə bilər.</p><p>Obyektlərdə, ofislərdə işçilərinizə nəzarət edə bilmək üçün və ya evinizdə körpənizə lazim olduqda baxmaq üçün 360° dərəcə görmə bucaqlı VR Kamera.<br>✅Kamera evinizdəki və ya obyektinizdəki wifiyə qoşularaq işləyir, tavandan asılır və hardan istəsəniz telefondakı proqrama girib Kameraya canlı baxa bilirsiniz.<br>✅Hərəkət sensoru funksiyası var. Bu özəlliyi qoşduqda kameranin önündə hərəkət olarsa telefonunuza avtomatik bildiriş gəlir.<br>✅Gecə görüşü özəlliyi ilə zil qaranlıqda belə aydın izləyə bilərsiniz.<br>✅Kamera olan yerdə səsi dinləyə bilərsiniz<br>✅kameraya telefonla səs yollaya bilərsiniz.</p>', '[\"\"]', '[\"\"]', 99, '[\"\"]', 19, 'VR Kamera 360 dərəcə', 'vr-kamera-360-derece', 252, 'true', '2024-03-17 12:26:12', 1617198840, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 19:51:20'),
(740, 1688843401, '[\"\"]', '<p><br></p><p>Wifi PTZ Kamera</p><p>Kamera Telefonla 360 derece firlanaraq istenilen yerə nezaret etmek mumkundur. Wifi funksiyasi var. Kabelsiz olaraq qoşulur sizin Wifinizə, istədiyiniz yerdən telefonda canlı izləyə bilirsiniz.</p><p>✅Maksimum 128GB yaddaş kartı dəstəkləyir. ✅Kameranı telefonunuzla 360 dərəcə sağa-sola,120 dərəcə yuxarı aşağı hərəkət etdirə bilərsiniz.</p><p>✅Kamera qarşısında hərəkət olan kimi dərhal ətrafı işıqlandıracaq.</p><p>✅Alarm özəlliyi var. Bu özəlliyi qoşduqda kameranin önündə hərəkət olarsa telefonunuza avtomatik bildiriş gəlir.</p><p>✅Gecə görüşü özəlliyi ilə zil qaranlıqda belə aydın izləyə bilərsiniz.</p><p>✅Kamera olan yerdə səsi dinləyə, kameraya telefonla səs yollaya bilərsiniz.</p><p>✅Wifi modeminizə həm kabel ilə, həmdə kabelsiz qoşula bilir.</p><p><br></p><p><br></p><p>Hashtags/açar sözlər</p><p>wifi kamera, ptz kamera, wifi ptz kamera, ptz camera, kamera, ip kamera, ev kamerasi, usaq kamerasi, tehlukesizlik kamerasi, wifi camera,</p>', '[\"\"]', '[\"\"]', 140, '[\"\"]', 15, 'Wifi PTZ Kamera 360 Dərəcə', 'wifi-ptz-kamera-360-derece', 252, 'true', '2024-03-17 12:26:12', 1619934874, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 19:50:59'),
(747, 1688843401, '[\"\"]', '<p>Şəhərkənarı ev, bağ və s. əmlaka onlayn video nəzarət etmək üçün rahat həlldir;</p><p><br></p><p>Bulud xidməti mobil telefonlardan pulsuz uzaqdan nəzarət və arxivə baxış təmin edir;</p><p><br></p><p>Optik genişlik 2 Mpx, maksimal genişlik 1920 x 1080 px (1080p);</p><p><br></p><p>Gecə görüntüsü 15-20m;</p><p><br></p><p>Qorizontal üzrə 360, vertikal üzrə 120 dərəcə fırlanma imkanı;</p><p><br></p><p>Videonun həm kompüterə, həm yaddaş kartına, həm registratora qeyd etmək imkanı;</p><p><br></p><p>İP66 müdafiə səviyyəsi, tempratur səviyyəsi - 10-50° С;</p><p><br></p><p>P2P funksiyası nəticəsində kameraya statik İP adres və xüsusi quraşdırma lazım deyil, sizə sadəcə kameranı internetə qoşub, lokal kompüterə və ya mobil telefona Yoosee proqramını yükləmək kifayətdir. </p><p><br></p><p>Xüsusiyyətləri:</p><p>Model</p><p><br></p><p>Model  P05 360°</p><p><br></p><p>Tip    P2P IP Wi-Fi kamera (HD)</p><p><br></p><p>Özəlliyi    IP66 müdafiə səviyyəsi, metalik korpus, fırlanan cihaz</p><p><br></p><p>Əsas xüsusiyyətləri:</p><p><br></p><p> Wi-Fi:    var</p><p><br></p><p>tempratur səviyyəsi    -10....+ 50 С</p><p><br></p><p>İstifadə bölgəsi:   Ev, ofis, əraziyə nəzarət</p><p><br></p><p>Quraşdırılma:    Məkan daxili və məkan xarici (kronşteynlə tavana)</p><p><br></p><p>Videoregistratorla uyğunlar:    Dəstəkləyir</p><p><br></p><p>Əməliyyat sistemi uyğunluğu:    PK, IOS, Android</p><p><br></p><p>Rəng, ölçü və çəki</p><p><br></p><p>Ölçülər    220 x 128 x 230 mm</p><p><br></p><p>Çəki    1.2 kg.</p><p><br></p><p>Rəng    Ağ</p><p><br></p><p>Fırlanma cihazı</p><p><br></p><p>Horizontal 360 dərəcə</p><p><br></p><p>Vertikal 120 dərəcə</p><p><br></p><p>Təhlükəsizlik xüsusiyyətləri</p><p><br></p><p>E-mail bildiriş: Var</p><p><br></p><p>Giriş yoxlanışı: Var</p><p><br></p><p>Məlumat ötürülməsi</p><p><br></p><p>Dəstəklənən formatlar   TCP/IP, HTTP, TCP, UDP, SMTP, FTP, DHCP, DNS, DDNS, NTP, UPNP, RTSP, P2P, ONVIF</p><p><br></p><p>Sürət   802.11b: 11 Mbps, 802.11g: 54 Mbps</p><p><br></p><p>Təhlükəsizlik: WEP / WPA / WPA2</p><p><br></p><p>Mobil telefonlar üçün tətbiq:    Android, IOS</p><p><br></p><p>Qidalandırma</p><p>Elektrik şəbəkəsindən qidalanma 220 V</p>', '[\"\"]', '[\"\"]', 130, '[\"\"]', 28, 'Wifi PTZ Kamera 360° Fırlanan', 'wifi-ptz-kamera-360-firlanan', 252, 'true', '2024-03-17 12:26:12', 1621572831, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 19:50:35'),
(749, 1689314073, '[\"\"]', '<p>Uşaq izləmə cihazı. Bu cihaz iki hissədən ibarətdir. Kamera və 3.2\" Monitor. Kamera uşaq olan otağa qoyulur monitoru isə valideyin istədiyi otağa qoya bilər.  Kamerada hərəkət sensoru var, uşaq yatan vaxt hər hansı bir hərəkət etsə dərhal monitor ekranı işığlanır. Kameraya quraşdırılmış temperatur sensoru var, valideyin uşağın otağının temperaturuna daimi nəzarət edə bilir. İki tərəfli səs ötürmə funksiyası var, uşağın səsini eşitmək  və danişmaq mümkündür. Kamera yüksək keyfiyyətli gecə görüntüsünə malikdir. Kameranın işləməyi üçün nə wifi nə də internetə ehtiyac yoxdur.</p><p><br></p><p><br></p><p>#babymonitor, #babycamera, #babycam, #usaqkamera, #evkamerasi, #videodaye, #videonanny, #usagkamerasi, #usag daye, #usaq kamera,</p><p><br></p><p><br></p>', '[\"\"]', '[\"\"]', 170, '[\"\"]', 40, 'Uşaq Kamerası Video Dayə', 'usaq-kamerasi-video-daye', 252, 'true', '2024-03-17 12:26:12', 1622882140, NULL, 'true', '1629377233,1632833596,1689314073,', '2024-03-17 19:50:17'),
(751, 1632833595, '[\"\"]', '<p>Öz avtomobilinizin surətini, yerini, hərəkət istiqamətini canlı olaraq telefonunuzda baxmaq üçün ideal aparatdır. Çox asan qoşulur. Birbaşa avtomobilin siqaret yandiran hissəsinə taxilir və cihazin yan terefden içerisine sim kart taxilir. Sim Cin Nar butun operatorlari destekleyir hansi nomreni istesez taxa bilersiniz. Əgər avtomobil oğurlanarsa və ya dostunuza verərsinizsə telefonda girib avtomobilin oldugu yeri dəqiqliklə görə bilərsiz. Yan tərəfi bağlı olduğu üçün GPS cihazi olduğu bilinmir. Adi zaryatka aparatı kimi görünür. Keçmiş günlərin tarixçəsini də yaddaşında saxlayır. Girib nəvaxt haralara getdiyini görmək mümkündür.</p><p>Aparata balaca sim kart taxib ayliq 500 meqabayt vəya 1GB yukleməklə meqabayt götürmək kifayətdir. Başqa heçbir xərci vəya abunə haqqı yoxdur.  Bundan başqa heçbir xərci vəya abunə haqqı yoxdur. Enerjisini özü avtomobildən götürəcək. Ailə üzvlərinin təhlükəsizliyinə nəzarət edə bilmək və ya RentaCar maşınları üçün ideal aparatdır.</p><p xss=removed><strong><span xss=removed>DİQQƏT !!!</span></strong></p><p><strong><span xss=removed>GPS cihazını yalnız öz avtomobilinizə quraşdıra bilərsiz. Başqasının icazəsi olmadan başqa avtomobilə bu cihazı quraşdırmaq qəti qadağandır və bu kimi hal baş verərsə TexnoStar.az heçbir məsuliyyət daşımır.</span></strong></p><p><br></p><p>Hashtags </p><p>gps, car gps, avtomobil gps, rentacar gps, #auto gps, gps naviqator, gps speed, gps location, avto gps, gps cihazi,  gps izleme, gps tracker, gps az, gps location, gps azerbaijan, gps ag, gps address, gps saat, gps meaning,</p><p>#gps, #car gps, #avtomobil gps, #rentacar gps, #auto gps, gps #naviqator, gps speed, gps #location, </p>', '[\"\"]', '[\"\"]', 140, '[\"\"]', 5, 'Avto GPS izləmə', 'gps-izleme', 252, 'true', '2024-03-17 12:26:12', 1622919370, NULL, 'true', '1629377137,1683657380,1632833595,', '2024-03-17 19:49:51'),
