(790, 1632833593, '[\"\"]', '<p>Wifi Qapı Zəngi/Domofon</p><p>Tam Kabelsiz Smart Wifi Domofon. Knopkasına vurulan kimi telefonunuza bildiriş göndərəcək. Həmçinin hərəkət sensorunu menyusundan aktiv etsəz knopkasına vurmasalar belə kimsə yaxinlaşan kimi sizə bildiriş göndərəcək</p><p>✅Tam Kabelsizdir</p><p>✅Daxili 2 ədəd Batereya qutusunda mövcuddur.</p><p>✅Zəngi vuran kimi telefona bildiriş göndərir</p><p>✅Zəng vurulmasa belə qapı qarşısında hərəkət hiss edən kimi telefona bildiriş göndərir.</p><p>✅Batereya ömrü 1-3 günə qədərdir və Yenidən zaryatka yığa  bilmə funksiyası var. Dəyişməyə ehtiyac yoxdur. Domofonu usb kabel ilə zaryatkaya qoşmaq kifayətdir. Batereya ömrü qapının önündə olan hərəkətlərin sıxlığından və sizin canlı görüntüyə baxma tezliyinizdən asılı olaraq 1-3 gündən az və yox çox olaraq dəyişə bilir. Tez tez girib canli baxsaz daha tez bitəcək.</p><p>✅Gecə Görmə Rejimi</p><p>Çatdırılma Pulsuzdur. </p><p>Sifariş üçün www.TexnoStar.az saytına daxil olun.</p><p><br></p><p>Hashtags/Açar sözlər</p><p>domofon, damofon, domofon baku, domofonlar, domofon ustasi, domofon wifi , wifi domofon, wifi qapi zengi, qapızengi, qapizengi, wireless doorbell, doorbell, wifi doorbell, wifi doorbell camera, kabelsiz domofon, #domofon #qapizengi #wifidomofon #doorbell #wifidoorbell</p>', '[\"\"]', '[\"\"]', 130, '[\"\"]', 9, 'Wifi Domofon Qapı Zəngi', 'wifi-domofon-qapi-zengi', 252, 'true', '2024-03-17 12:26:12', 1653113347, NULL, 'true', '1629377233,1632833596,1632833593,', '2024-03-17 19:41:39'),
