(795, 1617794492, '[\"\"]', '<p>Tam Kabelsiz Wifi Kamera daxili batereyaları sayəsində toka ehtiyac olmadan 1 g&uuml;n &ccedil;əkiliş edə bilir. Yalnız hərəkət olandan olana işə d&uuml;şd&uuml;y&uuml; &uuml;&ccedil;&uuml;n batereyasına qənaət edə bilir. Hərəkət olsa da olmasa da Siz istənilən vaxt mobil telefonla daxil olub canlı g&ouml;r&uuml;nt&uuml;yə baxa bilirsiniz.</p><p><br></p><p>WIFI Təhl&uuml;kəsizlik Kamerası &quot; BATAREYALI &quot;</p><p>Model: WIFI - M3</p><p>Rəng: Ağ</p><p>Təyinat: Ev,ofis,obyekt, və s.</p><p>Meqapixsel: 2MP / 1080</p><p>G&uuml;c: 5V. 1.5A</p><p>Batareya: 2 ədəd 6000 MAH batareyalar&nbsp;</p><p>Saxlama m&uuml;ddəti: &quot; 1-3 g&uuml;n&quot;</p><p>Lens: 3.6mm</p><p>Gecə/g&uuml;nd&uuml;z Mod: var&nbsp;</p><p>G&ouml;r&uuml;nt&uuml; dərəcəsi: 135&nbsp;</p><p>Proqram təminatı: &quot; Onecam APP &quot; ( İOS VƏ ANDROİD )&nbsp;</p><p>Mikrofon və dinamiklər, ikitərəfli səsi dəstəkləyir&nbsp;</p><p>Yaddaş n&ouml;v&uuml;: Micro SD kart, max. 128 GB</p>', '[\"\"]', '[\"\"]', 125, '[\"\"]', 0, 'Tam Kabelsiz Kamera ( Wifi)', 'tam-kabelsiz-kamera-wifi', 252, 'true', '2024-03-17 12:26:12', 1653586308, NULL, 'true', NULL, '2024-03-17 15:43:36'),
(796, 1628401299, '[\"\"]', '<p>4G Tam Kabelsiz G&uuml;nəş Panelli Kamera. WIFI olmayan yerlər &uuml;&ccedil;&uuml;n ideal Kameradir. Telefonla 7/24 canlı izləyə biləcəksiz. Kameraya sim kart taxaraq ayliq 5GB y&uuml;kləmək kifayətdir.</p><p><br></p><p><br></p><p><br></p><p>Kameranin nə toka, nədə Wifiyə ehtiyacı yoxdur.</p><p><br></p><p>✅Telefonla hardan istəsəniz girib canlı izləmək m&uuml;mk&uuml;nd&uuml;r.</p><p><br></p><p>✅Telefonla həm&ccedil;inin sağa sola 360 derece firlatmaq m&uuml;mk&uuml;nd&uuml;r. Kamera hazirda əldə var.</p><p><br></p><p>✅Kameranin Qarşısında hərəkət olan kimi telefona bidliriş g&ouml;ndərir.</p><p><br></p><p>✅Yanlız hərəkət hiss edən kimi yaddaşa yazir, hərəkət olmayanda yuxu rejiminə ke&ccedil;ərək enerjiyə qənaət edir.</p><p><br></p><p>✅Yağışa Qara davamlıdır.</p><p><br></p><p>✅Max 128GB kart dəstəkləyir.</p><p><br></p><p>✅Aparatın IMEI qeydiyyatı bizim tərəfimizdən aparılır.&nbsp;</p><p><br></p><p>Suallar &uuml;&ccedil;&uuml;n WhatsApp aktivdir&nbsp;</p><p><br></p><p>4G kamera, kabelsiz kamera, tehlukesizlik kamerasi, tehlukesizlik sistemleri, kamera servis, kamera qurasdirilma, 4G kamera, 4G camera, 4G kamera gunes panelli, 4g kamera kabelsiz, kabelsiz kamera, gunes panelli kamera, wi-fi kamera, kamera baki, kamera sistemleri baki, kamera online, video kamera, kamera qiymetleri, kamera satisi, wifi kamera baku, video kamera qiymetleri, mini kamera wifi baku, ip kamera qiymetleri, мини камеры купить в баку, камеры видеонаблюдения баку онлайн, беспроводные камеры видеонаблюдения</p><p><br></p>', '[\"\"]', '[\"\"]', 350, '[\"\"]', 0, '4G Günəş Panelli Kamera', '4g-gunes-panelli-kamera-yeni', 252, 'true', '2024-03-17 12:26:12', 1654049552, NULL, 'true', NULL, '2024-03-17 15:41:42'),
