(801, 1688843650, '[\"\"]', '<p>Bu VideoQeydiyyatçı Avtomobilinizi 4 tərəfdən əhatə edərək Sim kart Funksiyası sayəsində sizə 7/24 canlı görüntü təmin edəcək.</p><p>Sim kart taxmaya da bilərsiz. Bu halda da kamera çəkilişinə davam edir. Sim kart taxmadan kameraya qoşulmaq üçün isə avtomobilin 10 metrliyində olmaq kifayət edir.</p><p>Ekranı isə touch screendir. Menyular ekrana toxunaraq seçilir. Sistem Androiddir və müxtəlif naviqator proqramlarının yazılmağı mümkündür.</p><p>Əgər sim kart taxsaz Kamera meqabaytdan yalniz siz canlı baxanda istifadə edəcək. Digər vaxtlarda meqabayt sərf olunmayacaq. Bunun sayəsində ay ərzində 5GB internet vəya daha azı sizə bəs edəcək.</p><p>Hazırda Stokda bitdiyi üçün Sifarişlə gətiririk. 20 günə Bakıda olur.</p><p><br></p><p><br></p><p>Tir ucun Videoregistaror, Yuk masini ucun VideoRegistrator, Video registrator qiyməti, Masin ucun video registrator, videoqeydiyyatçı, gps izleme, gps, gps funksiyalı, videoregistratorucuz, videoregistrator qiymetleri, videoqeydiyyatçı qiymeti, videoregistratorbaku, videoqeydiyyatçıbakı, videoqeydiyatci, videoregistratorbaki, videoregistrator, videoregistratoraz, videoregistratore, dashcam, videoqeydiyyatçılar, videoregistrator qiymetleri, 3 kameralı videoregistrator, Kontakt home avtomobil, Kontakt home masin ucun tozsoran, Avtomobil videoqeydiyyatci, Güzgü videoreqistrator, Video qeydiyyat, Armata a22, Masin ucun video registrator, <a href=\"https://www.instagram.com/explore/tags/videoregistratorucuz/\" tabindex=\"0\"></a>4Gvideoqeydiyyatci, 4Gvideoregistrator, 4gdashcamera, <a href=\"https://www.instagram.com/explore/tags/videoqeydiyyatci/\" tabindex=\"0\"></a>videoqeydiyyatçılar, 360kamera, videoregistrator az, videoqeydiyyatci az,</p>', '[\"\"]', '[\"\"]', 430, '[\"\"]', 10, '4 Kameralı VideoRegistrator Android 4G', '4-kamerali-videoregistrator-android-4g', 252, 'true', '2024-03-17 12:26:12', 1676433039, NULL, 'true', '1629377137,1632833598,1688843650,', '2024-03-17 15:38:43'),
(802, 1688843650, '[\"\"]', '<p>Hazırda Stokda bitdiyi üçün Sifarişlə gətiririk. 20 günə Bakıda olur.</p><p><br></p><p>Bir Videoqeydiyyatçıda istəyəcəyiniz Hərşey bu 4 Kameralı Videoqeydiyyatçıda birləşib.</p><p><br></p><p>1. VideoRegistrator 4 Kameradan ibarətdir hansı ki, avtomobilinizi 360 dərəcə əhatə edəcək. Sistemi isə androiddir. Play store funksiyası var.</p><p><br></p><p>2.Videoqeydiyyatçının programında əsas üstünlüyü ondadır ki siz Mobil telefonunuzla canlı olaraq evinizdə oturaraq avtomobilinizin hərəkət sürətini getdiyi yolun xəritəsi önü, arxanı, sagı, solu rahatlıqla görə biləcəksiniz. Bu funksiya yalnız sim kart taxılarsa aktiv olacaq. Sim kart taxmaya da bilərsiz. Yaddaşa yazmaq üçün SD kart taxmaq kifayətdir </p><p><br></p><p>3. İstəyinizə uyğun olaraq Cihaz SİM kart dəstəkləyir nömrə yerləşdirə bilərsiniz qeyd edək ki istənilən operator nömrəsini dəstəkləyir və ən son 4G dəstəkləyir. Cihazda nömrə yerləşdib internetdən istifadə edə bilərsiniz. Həmçinin avtomobilinizi 7/24 canlı izləyə bilərsiz.</p><p><br></p><p>4. Bağlama içərsində GPS modul  və original güzgünü çıxarıb bu güzgünü zavod üslubunda quraşdırılma üçün bütün lazımı ləvazimatları vardır.</p><p><br></p><p>6. Xüsusi FM- Share Düyməsi sayəsində siz YouTube baxdığınız filimləri, radionu vəya başqa səsləri  bir başa maşının kalonkasına tam kabelsiz yönləndirə bilərsiniz.</p><p><br></p><p>7. Bakıdaxili Çatdırılma pulsuzdur</p><p><br></p><p>8. Ekranı söndürüb adi güzgü kimidə istifadə etmək olur. Arxa planda çəkiliş davam edir.</p><p><br></p><p><br></p><p><br></p><p>4 kameralı android güzgü videoqeydiyyatçı, 4 kamerali videoregistrator, 4 Kameralı guzgu VideoRegistrator, sim kart funksiyali videoregistrator,  4g android videoqeydiyyatci, 4G videoqeydiyyatci, 4g videoregistrator, dashcam, dashcamera, guzgu videoqeydiyyatci, guzgu videoregistrator, dashcamvideos, videoqeydiyyatci, videoregistrator, videoregistratorbaku, 4gdashcamera, android videoqeydiyyatci, android videoregistrator, </p>', '[\"\"]', '[\"\"]', 420, '[\"\"]', 9, '4G Android 4 Kameralı Güzgü VideoRegistrator', '4g-android-4-kamerali-guzgu-videoregistrator', 252, 'true', '2024-03-17 12:26:12', 1676437698, NULL, 'true', '1629377137,1632833598,1688843650,', '2024-03-17 15:38:19'),
(803, 1617794492, '[\"\"]', '<p>350azn</p><p>Daxili Batereyalı, 32GB daxili yaddaşlı cə &nbsp;G&uuml;nəş Panelli Yeni model Wifi Kameramızı qarşılayın</p><p>￼Kamera m&uuml;asir xarici g&ouml;r&uuml;n&uuml;ş&uuml; ilə yanaşı qabaqcıl funksionalı &ouml;z&uuml;ndə birləşdirir. Belə ki, ki&ccedil;ik &ouml;l&ccedil;&uuml;də olmasına baxmayaraq geniş linzalı obyektivi sayəsində b&ouml;y&uuml;k ərazini nəzarət altında saxlayan kamera, FullHD g&ouml;r&uuml;nt&uuml; &ouml;t&uuml;rmək qabiliyyətinə malikdir. Hətta gecə saatlarında belə 30m-dək m&uuml;kəmməl geci g&ouml;r&uuml;nt&uuml;s&uuml; əldə olunur.</p><p>￼Kameranın əsas &ouml;zəlliyi daxilə quraşdırılmış 32GB yaddaş və b&ouml;y&uuml;k həcimli 7800 milli amper Liti-ion batareyyasına malik olmasıdır.</p><p>￼Elektrik kabeli &ccedil;əkilməsi &ccedil;ətin və m&uuml;mk&uuml;n olmayan yerlərdə daxili yaddaş və b&ouml;y&uuml;k batereyası sayəsində kamera 1 ay kəsintisiz video m&uuml;şahidə aparmaq g&uuml;c&uuml;nə malikdir.</p><p>￼Kameranın &uuml;st&uuml;nl&uuml;kləri bununla bitmir! Əlavə quraşdırılan g&uuml;nəş paneli sayəsində kameranın tam avtononom işi təmin olunur yəni &ndash; 24/7 video m&uuml;şahidə aparmasına imkanı verir bu isə &ouml;z n&ouml;vbəsində kameranın naqilsiz istənilən yerə &ccedil;ox rahatlıqla montajına şərait yaradır.</p><p>￼Kamera daxilinə quraşdırılmış əməliyyat sistemi sayəsində video m&uuml;şahidə aparılan ərazidə baş verənləri y&uuml;ksək dəqiqlik və s&uuml;rətlə analiz edir &ndash; baş vermiş hadisələr haqqda istifadə&ccedil;iyə bildiriş g&ouml;ndərir.</p><p><br></p><p>2mp 1920 1080</p><p>7,800 mAh Litium Batareya</p><p>Daxili yaddaş 32GB</p><p>Rəngli Gecə G&ouml;r&uuml;nt&uuml;l&uuml;</p><p>IP66 Toz və Sudan M&uuml;hafizə</p><p>İnsanların Aşkarlanması (human detection)</p><p>2 Tərəfli Səs ( 2 way audio )</p><p>Fərdiləşdirilə Bilən Səsli Xəbərdarlıqlar</p><p>Video Sıxılma (video compression)</p><p>G&uuml;nəş Panelli</p><p>Bulud sistemi</p><p><br></p><p>Keywords: Kabelsiz kamera, simsiz kamera, gune