(804, 1617794492, '[\"\"]', '<p><span style=\"background-color: transparent; font-size: 1rem;\">&Ccedil;&ouml;l şəraiti &uuml;&ccedil;&uuml;n nəzərdə tutulmuş bu yeni model kamera təhl&uuml;kəsizliyiniz &uuml;&ccedil;&uuml;n y&uuml;ksək səmərəli cihazdır. Panoramik g&ouml;rmə qabiliyyətinə malikdir, bu da kor zonaları aradan qaldırır. Hava şəraitindən asılı olmayaraq 1080p təsvir &ouml;l&ccedil;&uuml;s&uuml;ndə y&uuml;ksək g&ouml;r&uuml;nt&uuml; keyfiyyəti a&ccedil;ıq havada baş verən hər şeyin aydın, ətraflı təsvirini təmin edir.</span></p><p><br></p><p>Yeni modelin x&uuml;susiyyətlərinə aşağıdakılar daxildir:</p><p>360&deg; panoramik g&ouml;r&uuml;n&uuml;ş</p><p>Qaranlıqda rəngli şəkillər</p><p>Formanın aşkarlanması</p><p>Quraşdırılmış siqnalizasiya (korna, işıqlar)</p><p>Tez quraşdırma</p><p>30 m radiuslu IR işıqlandırması</p><p>İki tərəfli s&ouml;hbət</p><p>Daha y&uuml;ksək performansa malik H.265 video sıxılma standartı</p><p>Toz və nəmə qarşı y&uuml;ksək dərəcədə qorunma</p><p>Belə bir ağıllı cihaz &ccedil;ox kameralı təhl&uuml;kəsizlik sistemini asanlıqla əvəz edə bilər.</p><p><br></p><p>Texniki x&uuml;susiyyətləri:&nbsp;</p><p><br></p><p>Şəkil Sensoru 1/2.7&quot; Proqressiv Skan CMOS</p><p>&Ccedil;ekim S&uuml;rəti &Ouml;z-&ouml;z&uuml;nə uyğunlaşan &ccedil;ekim</p><p>Lens 4mm @ F2.0, baxış bucağı: 46&deg; (şaquli), 89&deg; (&uuml;f&uuml;qi), 104&deg; (diaqonal) 6mm @ F2.0, baxış bucağı: 28&deg; (şaquli), 52&deg; (&uuml;f&uuml;qi), 60&deg; (diaqonal)</p><p>PT Bucaq Pan: 350&deg;, Tilt: 80&deg;</p><p>Minimum İşıqlandırma 0.5 Lux @ (F1.6, AGC ON), 0 Lux ilə IR (Məlumatlar EZVIZ laboratoriyalarından əldə edilir)</p><p>Lens M12</p><p>Avtomatik ke&ccedil;idli G&uuml;nd&uuml;z və Gecə IR-Cut filtri</p><p>DNR 3D DNR</p><p>WDR Rəqəmsal WDR</p><p>Gecə G&ouml;rmə Məsafəsi 30 m / 98 ft</p><p>Video &amp; Audio</p><p><br></p><p>Yaddaş:</p><p>Yerli yaddaş MicroSD kart yuvası Maksimum 512GB-a qədər kart dəstəkləyir&nbsp;</p><p><br></p><p>#wifikamerabaki #wifikamera #wificamera #wifikameralar #tehlukesizlikkameralari #tehlukesizliksistemleri&nbsp;</p>', '[\"\"]', '[\"\"]', 199, '[\"\"]', 0, 'Wifi Çöl Kamerası 360 Dərəcə', 'wifi-col-kamerasi-360-derece', 252, 'true', '2024-03-17 12:26:12', 1676794771, NULL, 'true', NULL, '2024-03-17 15:37:46'),
