(806, 1617794492, '[\"\"]', '<section>&nbsp; &nbsp; &nbsp;</section><p><br></p><p><img data-fr-image-pasted=\"true\" width=\"85\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_3-1.png\" alt=\"\" class=\"fr-fic fr-dii\" style=\"width: 77px; height: 58.8806px;\"> 1080p FullHD <img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_1-1.png\" alt=\"\" class=\"fr-fic fr-dii\">Rəngli gecə g&ouml;r&uuml;nt&uuml;<img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_2-1.png\" alt=\"\" class=\"fr-fic fr-dii\">S&uuml;ni intellekt vasitəsilə insan aşkarlama<img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_8-1.png\" alt=\"\" class=\"fr-fic fr-dii\">Daxili mikrofon<br><img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_4-1.png\" alt=\"\" class=\"fr-fic fr-dii\">H.265 video kompressiya<img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_5-1.png\" alt=\"\" class=\"fr-fic fr-dii\">2 xarici antena və 2.4GHz Wi-Fi<img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_6-1.png\" alt=\"\" class=\"fr-fic fr-dii\">Toz və su ke&ccedil;irtməyən IP67 korpus<img data-fr-image-pasted=\"true\" width=\"85\" height=\"65\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_7-1.png\" alt=\"\" class=\"fr-fic fr-dii\">256 GB-dək MicroSD kart dəstəyi</p><section><p><br></p><p>24 saat parlaq g&ouml;r&uuml;nt&uuml;.</p><p>Peşəkar optik linzalar, iki quraşdırılmış fənər və iki IR lampası tam qaranlıqda belə aydın rəngli təsvir əldə etməyə imkan verir. Bundan əlavə, ərazinizi işıqlandırmaq &uuml;&ccedil;&uuml;n fənərlərdən də istifadə edə bilərsiniz.</p></section><section><p>3 gecə g&ouml;r&uuml;nt&uuml; rejimi.</p><p>Əlavə işıqlandırmaya ehtiyac olmadıqda, kameranı ağ-qara gecə g&ouml;rmə rejiminə ke&ccedil;irərək işıqları s&ouml;nd&uuml;r&uuml;n və ya EZVIZ proqramında smart gecə g&ouml;rmə rejimini yandırın. Bu rejimdə C3N avtomatik olaraq işıqları yandırır və kadrda insanları aşkar etdikdə ağ-qaradan rəngə ke&ccedil;ir. Bunu etdiyiniz zaman rəngli video ilə bildiriş də alacaqsınız.</p>Rəngli gecə g&ouml;r&uuml;nt&uuml; rejimiAğ-qara rejim<img data-fr-image-pasted=\"true\" width=\"888\" height=\"282\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/5-min.png\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/5-min.png 888w, https://hikvision.co.az/wp-content/uploads/2021/12/5-min-300x95.png 300w, https://hikvision.co.az/wp-content/uploads/2021/12/5-min-600x191.png 600w\" sizes=\"(max-width: 888px) 100vw, 888px\" class=\"fr-fic fr-dii\"><p>Ağıllı gecə g&ouml;r&uuml;nt&uuml; rejimi</p></section><section><p>S&uuml;ni intellekt vasitəsilə insan aşkar edilməsi sistemi.</p><p>Bu kamerada hərəkət aşkarlama sistemi daxili s&uuml;ni intellektə əsaslanan insanların aşkarlanması alqoritmi ilə təkmilləşdirilmişdir. Bu, real vaxt rejimində insanlara oxşayan obyektləri aşkarlamağa və şəxs m&uuml;şahidə zonasına daxil olan kimi bildirişlər almağa imkan verir.</p><img data-fr-image-pasted=\"true\" width=\"988\" height=\"450\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/9c5e4c12fb4a4fb1a775387d8678c1de-min.jpg\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/9c5e4c12fb4a4fb1a775387d8678c1de-min.jpg 988w, https://hikvision.co.az/wp-content/uploads/2021/12/9c5e4c12fb4a4fb1a775387d8678c1de-min-300x137.jpg 300w, https://hikvision.co.az/wp-content/uploads/2021/12/9c5e4c12fb4a4fb1a775387d8678c1de-min-600x273.jpg 600w\" sizes=\"(max-width: 988px) 100vw, 988px\" class=\"fr-fic fr-dii\"></section><section><p>İnsanların daha aydın g&ouml;r&uuml;nt&uuml;s&uuml;.</p><p>C3N ətraf m&uuml;hitin ağıllı tanınmasına əsaslanan qabaqcıl g&ouml;r&uuml;nt&uuml; keyfiyyəti texnologiyasından istifadə edir. İnsanlar yaxınlaşdıqca, kamera həddindən artıq ifşanın qarşısını almaq &uuml;&ccedil;&uuml;n təsvirin parlaqlığını avtomatik tənzimləyir, beləliklə, siz adi kameralarla m&uuml;qayisədə daha ətraflı təsvirlər əldə edirsiniz.</p><img data-fr-image-pasted=\"true\" width=\"600\" height=\"319\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/123-min.jpg\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/123-min.jpg 600w, https://hikvision.co.az/wp-content/uploads/2021/12/123-min-300x160.jpg 300w\" sizes=\"(max-width: 600px) 100vw, 600px\" class=\"fr-fic fr-dii\">C3N gecə g&ouml;r&uuml;nt&uuml;s&uuml;<img data-fr-image-pasted=\"true\" width=\"600\" height=\"319\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/321-min.jpg\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/321-min.jpg 600w, https://hikvision.co.az/wp-content/uploads/2021/12/321-min-300x160.jpg 300w\" sizes=\"(max-width: 600px) 100vw, 600px\" class=\"fr-fic fr-dii\">Adi gecə g&ouml;r&uuml;nt&uuml;</section><section><p>Aktiv m&uuml;dafiə.</p><p>İnsanlar aşkar edildikdə, m&uuml;daxilə edənlərin qarşısını almaq &uuml;&ccedil;&uuml;n C3N-nin kamera işıqları avtomatik olaraq yanacaq* (həm&ccedil;inin əl ilə yandırıla bilər). Refoectorally işıq mənbəyinə &ccedil;evrilərək, şəxs kameranın g&ouml;r&uuml;n&uuml;ş&uuml;nə daxil olur və videoda aydın g&ouml;r&uuml;nəcək.</p><p>*Rəngli gecə g&ouml;rmə rejimi aktiv olduqda, işıqlar davamlı olaraq yanır və yanıb-s&ouml;nm&uuml;r.</p><img data-fr-image-pasted=\"true\" width=\"728\" height=\"734\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/54c37871186714213536c94096a221c5-min.jpg\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/54c37871186714213536c94096a221c5-min.jpg 728w, https://hikvision.co.az/wp-content/uploads/2021/12/54c37871186714213536c94096a221c5-min-298x300.jpg 298w, https://hikvision.co.az/wp-content/uploads/2021/12/54c37871186714213536c94096a221c5-min-150x150.jpg 150w, https://hikvision.co.az/wp-content/uploads/2021/12/54c37871186714213536c94096a221c5-min-600x605.jpg 600w\" sizes=\"(max-width: 728px) 100vw, 728px\" class=\"fr-fic fr-dii\"><p>Səs qeydi.</p><p>Səs-k&uuml;y&uuml; ləğv edən quraşdırılmış mikrofon 5 metrə qədər məsafədə səs yazmağa imkan verir. İndi siz nəinki g&ouml;rə bilərsiniz, həm də harada olduğunuzdan asılı olmayaraq ərazinizdə baş verən hər şeyi eşidə bilərsiniz.</p></section><section><p>Təkmilləşdirilmiş Wi-Fi bağlantısı.</p><p>C3N iki g&uuml;cl&uuml; xarici antena ilə təchiz edilmişdir, bunun sayəsində siqnal divarlardan m&uuml;kəmməl ke&ccedil;ir və m&uuml;daxiləyə davamlıdır. Router uzaqda olsa belə, C3N kamerasının bağlantısı həmişə yuxarıdadır.</p></section><section><p>Etibarlılıq və g&uuml;c.</p><p>Metal korpus kameranı etibarlı şəkildə qoruyur və təkmilləşdirilmiş istilik yayılmasını təmin edir. Bundan əlavə, kamera IP67 m&uuml;hafizə standartına cavab verir, ona g&ouml;rə də yağışlı, qarlı və k&uuml;ləkli g&uuml;nlərə tab gətirə bilir. B&uuml;t&uuml;n bunlar il boyu C3N-nin fasiləsiz işini təmin etməyə imkan verir.</p></section><section><p>Asan quraşdırma.</p><p>C3N, onu tavana və ya divara etibarlı şəkildə quraşdırmağa imkan verən 360&deg; fırlanan baza ilə təchiz edilmişdir. Kameranı bir ne&ccedil;ə sadə addımla quraşdırın və sizi he&ccedil; vaxt ruhdan salmayacaq ən m&uuml;asir təhl&uuml;kəsizlik sistemi əldə edin.</p><img data-fr-image-pasted=\"true\" width=\"600\" height=\"399\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/a7e7241a00a82506fba8c7f24a5387a91-min.jpg\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/a7e7241a00a82506fba8c7f24a5387a91-min.jpg 600w, https://hikvision.co.az/wp-content/uploads/2021/12/a7e7241a00a82506fba8c7f24a5387a91-min-300x200.jpg 300w\" sizes=\"(max-width: 600px) 100vw, 600px\" class=\"fr-fic fr-dii\"></section><section><p>M&uuml;xtəlif yaddaş həlləri.</p><p>&Ccedil;evik və təhl&uuml;kəsiz həllər ilə qeydlərinizi yadda saxlayın. C6N, 256 GB-a qədər qeydə alınmış g&ouml;r&uuml;nt&uuml;ləri saxlaya bilən daxili MicroSD kart yuvası ilə gəlir. Siz həm&ccedil;inin əlavə ehtiyat n&uuml;sxəsi &uuml;&ccedil;&uuml;n şəkillərinizi EZVIZ Cloud*-da saxlaya bilərsiniz.</p><img data-fr-image-pasted=\"true\" width=\"321\" height=\"320\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/f01ac0f9ff98f3394497d46cbcc7396d-min.png\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/f01ac0f9ff98f3394497d46cbcc7396d-min.png 321w, https://hikvision.co.az/wp-content/uploads/2021/12/f01ac0f9ff98f3394497d46cbcc7396d-min-300x300.png 300w, https://hikvision.co.az/wp-content/uploads/2021/12/f01ac0f9ff98f3394497d46cbcc7396d-min-150x150.png 150w\" sizes=\"(max-width: 321px) 100vw, 321px\" class=\"fr-fic fr-dii\">MicroSD Card dəstəkləyir Şifrələnmiş Bulud yaddaşı&nbsp;<p>*Bulud saxlama xidməti yalnız m&uuml;əyyən &ouml;lkələrdə m&ouml;vcuddur. Sifariş edərkən əvvəl m&ouml;vcudluğu yoxlayın.</p></section><section><p>Təhl&uuml;kəsizlik barmaqlarınızın ucunda.</p><p>EZVIZ Tətbiqi ilə siz dəyərli anları qeyd edə, yadda saxlaya, qoruya və paylaşa bilərsiniz.</p><img data-fr-image-pasted=\"true\" width=\"430\" height=\"585\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/12321-min.png\" alt=\"\" srcset=\"https://hikvision.co.az/wp-content/uploads/2021/12/12321-min.png 430w, https://hikvision.co.az/wp-content/uploads/2021/12/12321-min-221x300.png 221w\" sizes=\"(max-width: 430px) 100vw, 430px\" class=\"fr-fic fr-dii\"><img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_11.png\" alt=\"\" class=\"fr-fic fr-dii\"></section><section><br></section><section><p>Canlı yayım</p><img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_12.png\" alt=\"\" class=\"fr-fic fr-dii\">2-tərəfli audio <img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_13.png\" alt=\"\" class=\"fr-fic fr-dii\">Ani Xəbərdarlıqlar <img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_14.png\" alt=\"\" class=\"fr-fic fr-dii\">Video arxiv <img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_15.png\" alt=\"\" class=\"fr-fic fr-dii\">8x-dək zoom <img data-fr-image-pasted=\"true\" width=\"36\" height=\"36\" src=\"https://hikvision.co.az/wp-content/uploads/2021/12/screenshot_16.png\" alt=\"\" class=\"fr-fic fr-dii\">Ağıllı ev funksiyaları</section><section><br></section><section><p><br></p><p>kamera, ip kamera, ev kamerasi, tehlukesizlik kamerasi, wifi kameralar, tehlukesizlik kameralari, tehlukesizlik sistemleri, smart kamera,&nbsp;</p></section>', '[\"\"]', '[\"\"]', 169, '[\"\"]', 0, 'Wifi Çöl Kamerası 8X Zoom Funksiyalı', 'wifi-col-kamerasi-8x-zoom-funksiyali', 252, 'true', '2024-03-17 12:26:12', 1676803303, NULL, 'true', NULL, '2024-03-17 15:37:32'),
