(814, 1632833595, '[\"\"]', '<p>Öz avtomobilinizin surətini, yerini, hərəkət istiqamətini canlı olaraq telefonunuzda baxmaq üçün ideal aparatdır. Çox asan qoşulur. Birbaşa avtomobilin kod oxunulan hissəsinə taxilir və cihazin yan terefden içerisine sim kart taxilir. Sim Cin Nar butun operatorlari destekleyir hansi nomreni istesez taxa bilersiniz. Əgər avtomobil oğurlanarsa və ya dostunuza verərsinizsə telefonda girib avtomobilin oldugu yeri dəqiqliklə görə bilərsiz.  Keçmiş günlərin tarixçəsini də yaddaşında saxlayır. Girib nəvaxt haralara getdiyini görmək mümkündür.</p><p>Aparata balaca sim kart taxib ayliq 500 meqabayt vəya 1GB meqabayt götürmək kifayətdir. Başqa heçbir abunə haqqı yada xərci yoxdur. Enerjisini özü avtomobildən götürəcək. Ailə üzvlərinin təhlükəsizliyinə nəzarət edə bilmək və ya RentaCar maşınları üçün ideal aparatdır.</p><p xss=removed><strong><span xss=removed>DİQQƏT !!!</span></strong></p><p><strong><span xss=removed>GPS cihazını yalnız öz avtomobilinizə quraşdıra bilərsiz. Başqasının icazəsi olmadan başqa avtomobilə bu cihazı quraşdırmaq qəti qadağandır və bu kimi hal baş verərsə TexnoStar.az heçbir məsuliyyət daşımır.</span></strong></p><p>Hashtags </p><p>gps, car gps, taksi ucun gps, taxi gps, taksi gps,  avtomobil gps, rentacar gps, auto gps, gps naviqator, gps speed, gps location, avto gps, gps cihazi,  gps izleme, gps tracker, gps az, gps location, gps azerbaijan, gps ag, gps address, gps saat, gps meaning, rentacar gps, gps for cars, avtomobil ucun gps, rentakar gps, gps navigator, </p>', '[\"\"]', '[\"\"]', 140, '[\"\"]', 10, 'GPS izləmə avtomobil üçün', 'gps-izleme-avtomobil-ucun', 252, 'true', '2024-03-17 12:26:12', 1693030279, NULL, 'true', '1629377137,1683657380,1632833595,', '2024-03-17 15:36:17'),
(815, 1688843401, '[\"\"]', '<p dir=\"ltr\">3 Linzalı 12 Meqapiksel Wifi Kamera<br>Bu kameranın nəzarət edə bilmədiyi hər hansı kor nöqtəsi yoxdur. Üstdəki 2 Kamerası sağ və sola baxanda, aşağıdakı fırlanan kamera geriyə baxaraq ərazini 360 dərəcə əhatə edir. Beləliklə digər kameralardan fərqli olaraq kor nöqtə problemini aradan qaldırır. Ultra HD 5K keyfiyyətdə çəkiliş edə bilən bu kameranın hər 3 kamerası ayrı-ayrılıqda 4 Meqapiksel olmaqla ümumilikdə 12Meqapiksel görüntü hasil edir. Kameranın səs siqnalı, Avto Patrul rejimi, iki tərəfli səs sistemi də mövcuddur. Yağışa qara tam davamlıdır. Mobil telefonunuza çox asanlıqla quraşdırılır.<br><strong>#wifikamera</strong> <strong>#3linzalıkamera</strong> <strong>#kabelsizkamera</strong> <strong>#evkamerasi</strong> <strong>#tehlukesizliksistemleri</strong> #tehlukesizlikkameralari #videonezaret #videomüşahidəsistemi #tehlukesizlikkamerasi </p>', '[\"\"]', '[\"\"]', 196, '[\"\"]', 19, '3 Linzalı Wifi Kamera 12MP', '3-linzali-wifi-kamera-12mp', 252, 'true', '2024-03-17 12:26:12', 1693502295, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 15:35:46'),
(816, 1617794492, '[\"\"]', '<p>2 Linzalı kamera ilə daha dəqiq g&ouml;r&uuml;nt&uuml; təqdim edən bu kamera həm&ccedil;inin led işıqlar ilə təchiz olunub. 8 Meqapiksel g&ouml;r&uuml;nt&uuml; keyfiyyətinə sahib olan bu kamera ULTRA HD keyfiyyətdə &ccedil;əkiliş edir. Gecə qarşısında hərəkət olan kimi led işıqları yanaraq ətrafı işıqlandırır. Telefonla 7/24 kameraya nəzarət etmək və 360&deg; fırlatmaq m&uuml;mk&uuml;nd&uuml;r.</p><p><br></p><p>✅Maksimum 128GB yaddaş kartı dəstəkləyir.</p><p><br></p><p>✅Kameranı telefonunuzla 360 dərəcə sağa-sola,120 dərəcə yuxarı aşağı hərəkət etdirə bilərsiniz.</p><p><br></p><p>✅Telefona yazılacaq Program iCam365. IOS və Android dəstəkləyir.</p><p><br></p><p>✅Alarm &ouml;zəlliyi var. Bu &ouml;zəlliyi qoşduqda kameranın &ouml;n&uuml;ndə hərəkət olarsa telefonunuza avtomatik bildiriş gəlir.</p><p><br></p><p>✅Gecə g&ouml;r&uuml;ş&uuml; &ouml;zəlliyi ilə zil qaranlıqda belə aydın izləyə bilərsiniz.</p><p><br></p><p>✅Kameranın qarşısında adam hərəkət edərsə o gedən tərəfə avtomatik fırlanma funksiyası var. (Avto Patrul)</p><p><br></p><p>✅Kamera olan yerdə səsi dinləyə, kameraya telefonla səs yollaya bilərsiniz.</p><p><br></p><p>✅Interneti həm kabelsiz, həm də kabel ilə qəbul edə bilir.</p><p><br></p><p>Bakıdaxili &Ccedil;atdırılma Pulsuzdur</p><p><br></p><p>Hashtags/Keywords</p><p><br></p><p>kabelsiz wifi, 4g kamera, texnostar, qapı zəngləri, qapı zəngi,&nbsp; domofon, wifi kamera, wifi kameralar, sim kartla &ccedil;alışan kamera, kamera nədir, Ip Wifi Kamera, Sim Kartlı kamera, Wifi Kamera</p>', '[\"\"]', '[\"\"]', 170, '[\"\"]', 0, 'Wifi Kamera 2 Linzalı 8MP', 'wifi-ip-kamera-2-linzali-8mp', 252, 'true', '2024-03-17 12:26:12', 1693503039, NULL, 'true', NULL, '2024-03-17 15:35:28');
