(818, 1652963030, '[\"\"]', '<p>3 Kameralı VideoRegistrator.</p><p>64GB Yaddaş Kartı Hədiyyə!!!</p><p>Bu Videoregistrator eyni anda həm avtomobilinizin önünü, salonunu və arxasını çəkərək yaddaşa yazacaq. Digər 3 kameralılardan fərqli olaraq 3cü kamera da yaddaşa yazır.</p><p>Ekran :  IPS LCD screen</p><p>Görünüş bucağı ön : 170°</p><p>Görünüş bucağı salon: 165°</p><p>Görünüş bucağı arxa: 140°</p><p>Wi-Fi : yoxdur</p><p>Yaddaş kartı dəstəyi : Maksimum 64GB-ə qədər (10 class)</p><p>Çəkiliş formatı : FHD 1920 * 1080P, 30fps/S</p><p>Özəlliklər : G-sensor, Parking, WDR</p><p>Brend : Pro Cam</p><p>Rəng : Qara</p><p>Gecə çəkilişi rejimi : Var</p><p>Kameraların sayı : 3</p><p>Mikrafon : Var</p><p>Videoqeydiyyatcilar, Videoregistratorlar, 3 Kameralı VideoQeydiyyatçı, 3 Kameralı VideoRegistrator </p>', '[\"\"]', '[\"\"]', 140, '[\"\"]', 20, '3 Kamerali VideoRegistrator', '3-kamerali-videoregistrator', 252, 'true', '2024-03-17 12:26:12', 1695273365, NULL, 'true', '1629377137,1632833598,1652963030,', '2024-03-17 15:34:52'),
(819, 1688843650, '[\"\"]', '<p>Eyni anda həm salonu həmdə avtomobilinizin önünü çəkən bu VideoRegistratorun ən vacib funksiyası sim kart dəstəkləməyidir. Kameraya içərisində meqabayt olan sim kart taxsaz, telefonla istənilən məsafədən avtomobilinizin həm salonunu, həm də önünü canlı izləyə biləcəksiniz. </p><p>✅Bu kamerada 2 tərəfli səs rejimi də mövcuddur. Canlı izləyərkən həm səsləri eşidəcəksiniz, əlavə olaraq stəsəz salonda əyləşənlərə öz səsinizi göndərə biləcəksiniz.</p><p>✅Canlı izləməklə yanaşı, avtomobilinizin yerini xəritədə canlı olaraq görə biləcəksiniz. Istəsəniz bir neçə gün əvvəl haralarda olduğuna da GPS tarixçəsi vasitəsilə baxa biləcəksiniz.</p><p>✅Ön kamera 1080P, salon kamerası isə 720P çəkiliş imkanına malikdir </p><p>✅Siz kameraya canlı baxmadığınız halda kamera heç bir meqabayt sərf etmir. Nəticədə aylıq meqabayta qənaət etmiş olacaqsınız.</p><p>✅Kamera canlı baxmaq üçün məsafə limiti yoxdur, Yaddaş kartı taxaraq yaddaşına baxmaq istəyəndə isə mütləq avtomobilin yaxınlığında olmalısınız. GPS tarixçəsinə uzaqdan baxa bilsəz də, köhnə videolara uzaqdan baxmaq mümkün deyil. Kameranın 20-30 metrliyində olmaq kifayətdir ki, Köhnə videolara baxa biləsiniz.</p><p><br></p><p>4g VideoQeydiyyatçı, 4g VideoRegistrator, sim kartli VideoRegistrator, uzaqdan izlenen VideoRegistrator, uzaqdan izlenen VideoQeydiyyatçı, VideoRegistrator baku, </p>', '[\"\"]', '[\"\"]', 260, '[\"\"]', 2, '4G VideoQeydiyyatçı Procam B22', '4g-videoqeydiyyatci-procam-b22', 252, 'true', '2024-03-17 12:26:12', 1704378420, NULL, 'true', '1629377137,1632833598,1688843650,', '2024-03-17 15:34:36'),
(820, 1689252539, '[\"\"]', '<p>4K Ultra HD çəkiliş imkanına malik bu  3 Kameralı Güzgü VideoQeydiyyatçı. Önü, Salonu, Arxanı eyni anda çəkir və yaddaş yazır. Əlavə olaraq wifi funksiyası da mövcuddur ki, bu funksiya sayəsində avtomobilin yaxınlığında olanda, kameraya qoşularaq yaddaşında olan videolara baxmaq mümkündür.</p>', '[\"\"]', '[\"\"]', 290, '[\"\"]', 2, '3 Kameralı VideoQeydiyyatçı Güzgü', '3-kamerali-videoqeydiyyatci-guzgu', 252, 'true', '2024-03-17 12:26:12', 1704384156, NULL, 'true', '1629377137,1632833598,1689252539,', '2024-03-17 15:34:19'),
(821, 1688843447, '[\"\"]', '<p>Günəş enerjisi ilə işləyən kamera Sim Kart funksiyalı</p><p>Internete sim nömrə vasitəsi ilə qoşulur. </p><p>Evinizi ofisinizi dukanınızı istədiyiniz yerdən telefon və ya kompyuter vasitəsi ilə internetə qoşulub izleyə bilərsiniz</p><p>1 kamera obyektin her terefini göstərə bilir.</p><p>345 derece sağa sola</p><p>35 derece yuxari aşagi donen kamera</p><p>Çəkmə bucağı 107 dərəcə</p><p>Telefon vasitesi ile istediyiniz terefe kamerani donderib baxa bilersiz</p><p>Iki terefli ses sistemi, obyektdeki sese qulaq asa ve danisa bilersiz</p><p>Kameranin qarşisinda hereket qeyde alinan zaman sesli ve isiqli sirena verir.</p><p>Yaddasha yazma funksiyasi var, 128GB -kimi kart destekleyir (kart ustunde verilmir)</p>', '[\"\"]', '[\"\"]', 250, '[\"\"]', 2, 'Günəş enerjisi ilə işləyən kamera Sim Kart funksiyalı', 'gunes-enerjisi-ile-isleyen-kamera-sim-kart-funksiyali', 252, 'true', '2024-03-17 12:26:12', 1705769340, NULL, 'true', '1629377233,1632833596,1688843447,', '2024-03-17 15:34:02'),
(822, 1689252539, '[\"\"]', '<p>Videoqeydiyyatçı Azdome PG17 + Arxa kamera və 128GB yaddaş kartı Hədiyyə!!!</p><p>Ekran ölçüsü: 11.8\"</p><p>Prosessor: Mstar MS8339</p><p>Sensor: 1/2.9\" CMOS, GalaxyCore GC2053</p><p>Ön kamera çəkiliş: 170 dərəcə 1296p yəni 2K Ultra HD</p><p>Arxa kamera çəkiliş:150 dərəcə 1080p yəni Full HD</p><p>WiFi vasitəsi ilə telefona qoşulur. və videolari telefona yükləmək olur(evdən oturub canlı izləmək üçün deyil)</p><p>GPS vasitəsi ilə sürəti və koordinatı videoda qeyd edir. (maşın izləmək üçün GPS deyil)</p><p><br></p><p>videoqeydiyyatçı azdome pg17, videoregistrator, avtoqeydiyyatçı, </p>', '[\"\"]', '[\"\"]', 255, '[\"\"]', 20, 'AzDome PG17 Güzgü VideoQeydiyyatçı', 'azdome-pg17-guzgu-videoqeydiyyatci', 252, 'true', '2024-03-17 12:26:12', 1705770798, NULL, 'true', '1629377137,1632833598,1689252539,', '2024-03-17 15:33:34'),
(823, 1688843401, '[\"\"]', '<p>5 Linzalı 20X Zoom Funksiyalı 20 Meqapiksel Wifi PTZ Kamera</p><p>Bu kameranın nəzarət edə bilmədiyi hər hansı kor nöqtəsi yoxdur. Üstdəki 2 Kamerası sağ və sola baxanda, aşağıdakı fırlanan 3 Linzalı kamera isə geriyə baxaraq ərazini 360 dərəcə əhatə edir. Beləliklə digər kameralardan fərqli olaraq kor nöqtə problemini aradan qaldırır. Ultra HD 10K keyfiyyətdə çəkiliş edə bilən bu kameranın hər 5 kamerası ayrı-ayrılıqda 4 Meqapiksel olmaqla ümumilikdə 20 Meqapiksel görüntü hasil edir. Kameranın səs siqnalı, Avto Patrul rejimi, iki tərəfli səs sistemi də mövcuddur. Yağışa qara tam davamlıdır. Mobil telefonunuza çox asanlıqla quraşdırılır.</p><p>wifikamera, wifi kameralar, 5 linzalı kamera, evkamerasi, tehlukesizliksistemleri, tehlukesizlikkameralari, videonezaret, videomüşahidə sistemi, tehlukesizlikbkamerasi </p>', '[\"\"]', '[\"\"]', 240, '[\"\"]', 10, '5 Linzalı Wifi Kamera 20X Zoom', '5-linzali-wifi-kamera', 252, 'true', '2024-03-17 12:26:12', 1706812613, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 15:33:18'),
(824, 1688843447, '[\"\"]', '4G Tam Kabelsiz Günəş Panelli Kamera. WIFI olmayan yerlər üçün ideal Kameradir. Telefonla 7/24 canlı izləyə biləcəksiz. Kameraya sim kart taxaraq ayliq 5GB yükləmək kifayətdir.</p><p><br></p><p>Kameranin nə toka, nədə Wifiyə ehtiyacı yoxdur.</p><p>✅Telefonla hardan istəsəniz girib canlı izləmək mümkündür.</p><p>✅Telefonla həmçinin sağa sola 360 derece firlatmaq mümkündür. Kamera hazirda əldə var.</p><p>✅Kameranin Qarşısında hərəkət olan kimi telefona bidliriş göndərir.</p><p>✅Yanlız hərəkət hiss edən kimi yaddaşa yazir, hərəkət olmayanda yuxu rejiminə keçərək enerjiyə qənaət edir.</p><p>✅Yağışa Qara davamlıdır.</p><p>✅Max 128GB kart dəstəkləyir.</p><p>Sim kart, Yaddaş kartı, meqabayt müştəri tərəfindən alınır və Kameranın IMEI qeydiyyatı bizim tərəfimizdən edilib. Istifadəyə tam hazırdır.</p><p>Suallar üçün WhatsApp aktivdir </p>', '[\"\"]', '[\"\"]', 290, '[\"\"]', 10, 'Günəş Panelli Sim Kart Funksiyalı Kamera', 'gunes-panelli-sim-kart-funksiyali-kamera', 252, 'true', '2024-03-17 12:26:12', 1708111557, NULL, 'true', '1629377233,1632833596,1688843447,', '2024-03-23 09:43:38'),
(825, 1688843401, '[\"\"]', '<p>2 Linzalı 5 Meqapiksel Lampa Kamera</p><p>32GB yaddaş kartı hədiyyə!!!</p><p>Quraşdırılması 5 saniyəyə başa gələn bu kamera, 360 dərəcə avtomatik fırlanaraq hər tərəfi əhatə edəcək.</p><p>Avto Patrul Rejimli</p><p>2 Tərəfli səs sistemi</p><p>Gecə rejimli</p><p>Hərəkət sensoru</p><p>Bakidaxili 2 saata qapiyadek çatdırılma pulsuz.</p><p><br></p>', '[\"\"]', '[\"\"]', 135, '[\"\"]', 10, 'Lampa Kamera 2 Linza 5MP', 'lampa-kamera-2-linza-5mp', 252, 'true', '2024-03-17 12:26:12', 1708112240, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 15:32:46'),
(826, 1688843401, '[\"\"]', '<p>Yeni 2 Linzalı Kameralarımız gəldi</p><p>4K Çəkiliş keyfiyyəti 8 Meqapiksel.</p><p>2 Linzalı kamera ilə daha dəqiq görüntü təqdim edən bu kamera həmçinin led işiqlar ilə təchiz olunub. Gecə qarşısında hərəkət olan kimi led işiqları yanaraq ətrafı işıqlandırır. Telefonla 7/24 kameraya nəzarət etmək və 360° fırlatmaq mümkündür.</p><p>Kameranin biri sola, digəri sağa baxanda öndə olan bütün ərazini rahatlıqla müşahidə edə bilirsiniz.</p><p><br></p><p>✅Maksimum 128GB yaddaş kartı dəstəkləyir.</p><p><br></p><p>✅Kameranı telefonunuzla 360 dərəcə sağa-sola,120 dərəcə yuxarı aşağı hərəkət etdirə bilərsiniz.</p><p><br></p><p>✅Telefona yazilacaq Program icSee. IOS və Android dəstəkləyir.</p><p><br></p><p>✅Alarm özəlliyi var. Bu özəlliyi qoşduqda kameranin önündə hərəkət olarsa telefonunuza avtomatik bildiriş gəlir.</p><p><br></p><p>✅Gecə görüşü özəlliyi ilə zil qaranlıqda belə aydın izləyə bilərsiniz.</p><p><br></p><p>✅Kameranın qarşisinda adam hərəkət edərsə o gedən tərəfə avtomatik fırlanma funksiyası var. (Avto Patrul)</p><p><br></p><p>✅Kamera olan yerdə səsi dinləyə, kameraya telefonla səs yollaya bilərsiniz.</p><p><br></p><p>✅Interneti həm kabelsiz, həm də kabel ilə qəbul edə bilir.</p><p><br></p><p>Bakıdaxili Çatdırılma Pulsuzdur</p><p>Qitməti 160azn</p><p><br></p><p>Hashtags/Keywords</p><p><br></p><p>#wifismartkamera #wifikamerabaki #kameralar #kamerabaku #ipkamera</p>', '[\"\"]', '[\"\"]', 160, '[\"\"]', 10, 'Wifi PTZ Kamera 2 Linzalı', 'wifi-ptz-kamera-2-linzali', 252, 'true', '2024-03-17 12:26:12', 1708112684, NULL, 'true', '1629377233,1632833596,1688843401,', '2024-03-17 15:32:28'),
(827, 1632833593, '[\"\"]', '<p>Qlazok Wifi Kamera 2 Meqapiksel 1080P</p><p>Bu kamera sizin adi qlazokunuzu əvəzləyərək evinizə gələnləri evdə olmasanız belə görə biləcəksiniz</p><p>✅Telefona yazılacaq Proqram adı: Liana</p><p>✅Hərəkət olduqca proqram vasitəsilə sizə bildiriş göndərir</p><p>✅Gecə Rejimi var</p><p>✅Mikrofonu var. Danışılan səsləri eşidə bilirsiniz</p><p>✅32GB daxili yaddaşı var. Bütün baş verənləri videoya yazır. Istənilən məsafədən köhnə videoları izləməyə bilirsiniz.</p><p>✅2 Saata Bakıdaxili qapiyadek Pulsuz Çatdırılma</p><p><br></p><p>qlazok kamera, wifi qlazok kamera, domofon kamera, domofon,</p><p><br></p>', '[\"\"]', '[\"\"]', 155, '[\"\"]', 10, 'Qlazok Kamera Wifi Funksiyalı', 'qlazok-kamera-wifi-funksiyali', 252, 'true', '2024-03-17 12:26:12', 1710604283, NULL, 'true', '1629377233,1632833596,1632833593,', '2024-03-21 08:42:22'),
(3158, 1688491915, '[\"\"]', 'Sag, Sol, Ön və Arxa çəkilişli Full HD Videoqeydiyyatci\r\n\r\n4 Kameralı VideoQeydiyyatçı / VideoRegistrator\r\n\r\nSifariş 2 saata pulsuz çatdırılma edilir.\r\n\r\nBu 4 Kameralı VideoRegistrator Avtomobilinizi hər tərəfdən əhatə edəcək.\r\n\r\n✅ Ön çəkiliş 2K Full HD 170° dərəcə.\r\n\r\n✅ Salon çəkilişləri 2 Kamera 1920x1080p FHD 30fps 150° dərəcə.\r\n\r\n✅ Arxa çəkiliş 1920x720p HD 24fps 150° dərəcə.\r\n\r\n✅ Zərbə Sensoru var.\r\n\r\n✅ Qəza video çəkilişi var.\r\n\r\n✅ G-Sensor\r\n\r\n✅ Ekran 2.86 inch İPS\r\n\r\n✅ Yaddaş 32GB,64GB, 128GB artırılması mümkündür.\r\n\r\n✅ Çəkilmiş videoları cihazın ekranından izləmə.\r\n\r\n✅Çəkiliş videoları Wifi vasitəsilə izləmə imkanı.\r\n\r\n✅ Eyni anda 4 kameranın çəkilişi yaddaşda saxlanılması mümkündür.\r\n\r\n✅ Avtomobil -R- verdikdə Parking zamanı köməklik.\r\n\r\n4 Kameralı VideoQeydiyyatçı, 4 Kamerali VideoRegistrator, 360 derece videoregistrator, 360 derece videoqeydiyyatçı, avtokamera, VideoQeydiyyatçı 4 kamerali, 360 derece kamera, videoqeydiyyatçıbakı videoqeydiyyatçılar, videoqeydiyyatci videoqeydiyyatçı, videoregistratorbaku, videoregistrator, avtoqeydiyyatçı, Videoqeydiyyatci,', '[\"\"]', '[\"\"]', 260, '[\"\"]', 10, '4 Kameralı VideoQeydiyyatçı', '4-kamerali-videoqeydiyyatci56344-1021', 252, 'true', '2024-03-22 06:25:27', 1711087871, '1', 'true', '1629377137,1632833598,1688491915,', '2024-03-22 06:25:27'),
